import axios from "axios";
import { json } from "body-parser";
import React from "react";
import {useState, useEffect} from "react";

function Todo(){

    const [data, setData]= useState([])
    const item=[];
    useEffect(()=>{
        apiGet();  
    },[])
    const apiGet = ()=>{
        axios.get('http://localhost:1337/api/notice')
        .then((response) =>{
            const allData=response.data.user;
            setData(allData)
        })
        .catch(error=>console.error(`error:${error}`));
    }

    const displatData = (props) =>{
        const {data} = props;
        if(data.length>0){
            return(
                data.map((data,index)=>{
                    console.log(data);
                    return(
                        <div>
                            <h3>{data.name}</h3>
                        </div>
                    )
                })
            )
        }
        else{
            return (<h3>No Notice</h3>)
        }
    }


    return (

        <div>
            {data}
    </div>
    )
}

export default Todo

